import React, {Fragment} from 'react';
import '@lottiefiles/lottie-player';

import { withNamespaces } from 'react-i18next';
import FaceIcon from '@material-ui/icons/Face';
import LockIcon from '@material-ui/icons/Lock';
import {Link} from "react-router-dom";
const FormComponent =({t}) => {
    return <Fragment>
        <div className="form">

            <div className="sh_form">
                <lottie-player src="https://assets4.lottiefiles.com/datafiles/XRVoUu3IX4sGWtiC3MPpFnJvZNq7lVWDCa8LSqgS/profile.json"  background="transparent"  speed="1"  style={{width: '300px', height: '300px', display: 'flex', margin: 'auto', justifyContent: 'center'}}loop  autoplay/>
                <div className="sh_join">
                    <span className="sh_iconForm"><FaceIcon/></span>
                    <input className={"sh_input"} type="text" />
                </div>
                <div className="sh_join">
                    <span className="sh_iconForm"><LockIcon/></span>
                    <input className={"sh_input"} type="text" />
                </div>

                <Link to="/login" className="sh_btn">CONTINUE</Link>
                <Link to="/register" className="sh_btn">REGISTER</Link>

                <button type="button" onClick={()=>console.log('')}>SIGN UP</button>
            </div>

        </div>
    </Fragment>
}

export default withNamespaces()(FormComponent);
